using System;
using UnityEngine;

namespace TheBeginning.DebugViewPage
{
    public struct DebugViewStatic
    {
        public const string ICON_ADS_DEBUG =
            "";

        public const string ICON_TOOL_DEBUG =
            "";

        public const string ICON_LEVEL_DEBUG =
            "";

        public const string ICON_NEXT_DEBUG =
            "";

        public const string ICON_BACK_DEBUG =
            "";

        public const string ICON_TOGGLE_DEBUG =
            "";

        public const string ICON_WIN_DEBUG =
            "";

        public const string ICON_LOSE_DEBUG =
            "";

        public const string ICON_INPUT_DEBUG =
            "";

        public const string ICON_OK_DEBUG =
            "";

        public static Sprite CreateIconDebug(string iconBase64String)
        {
            var tex = new Texture2D(64, 64);
            tex.LoadImage(Convert.FromBase64String(iconBase64String));
            return Sprite.Create(tex, new Rect(0.0f, 0.0f, tex.width, tex.height),
                new Vector2(0.5f, 0.5f), 100.0f);
        }

        public static Sprite IconAdsDebug => CreateIconDebug(ICON_ADS_DEBUG);
        public static Sprite IconToolDebug => CreateIconDebug(ICON_TOOL_DEBUG);
        public static Sprite IconLevelDebug => CreateIconDebug(ICON_LEVEL_DEBUG);
        public static Sprite IconWinDebug => CreateIconDebug(ICON_WIN_DEBUG);
        public static Sprite IconLoseDebug => CreateIconDebug(ICON_LOSE_DEBUG);
        public static Sprite IconNextDebug => CreateIconDebug(ICON_NEXT_DEBUG);
        public static Sprite IconBackDebug => CreateIconDebug(ICON_BACK_DEBUG);
        public static Sprite IconToggleDebug => CreateIconDebug(ICON_TOGGLE_DEBUG);
        public static Sprite IconInputDebug => CreateIconDebug(ICON_INPUT_DEBUG);
        public static Sprite IconOkeDebug => CreateIconDebug(ICON_OK_DEBUG);
    }
}